(492, 'Shaymin', 'shaymin', 'Shaymin', 'Gratitude Pokémon', 4, null, 253, 5, 8, null, -1, 45, 100, false, 120, false, 4, true, 493, null, 'Forms have different stats and can learn different moves.  Moves are retained through form changes.  Shaymin transforms into Sky Forme with the use of a []{item:gracidea}.  It is limited to Land Forme at night, when [frozen]{mechanic:frozen}, and in the storage system boxes; under these conditions, Sky Shaymin reverts to Land Forme, and the Gracidea has no effect.  The Gracidea must be used again to return to Sky Forme.\n\nIn Generation IV, Shaymin is also limited to Land Forme in the Wi-Fi Club and the Union Room.\n\nA Gracidea may be received by showing a Shaymin met in a fateful encounter to a certain NPC, depending on the game:\n\n* Platinum: A woman in southwest []{location:floaroma-town}.\n* HeartGold and SoulSilver: The owner of the []{location:goldenrod-city} flower shop.\n* Black and White: A woman in the []{location:lacunosa-town} Pokémon Center.\n* Black 2 and White 2: A woman in the []{location:striaton-city} Pokémon Center.'),
